import {
  Accordion,
  AccordionDetails,
  AccordionSummary,
  Typography,
} from "@material-ui/core";
import "./Flight.css";

import { useState } from "react";
import { Modal, Button, Table } from "antd";
import ModalFlight from "./ModalFlight";

const dataSource = [
  {
    key: 1,
    logo: (
      <img
        src="https://static.wixstatic.com/media/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg/v1/fill/w_1000,h_626,al_c,q_90,usm_0.66_1.00_0.01/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg"
        alt="logo-brand"
        width="100px"
      />
    ),
    brand: "VietNam Airline",
    flight: "VNU123",
    time: "09:10 - 11:25",
    price: 1200000,
  },
  {
    key: 2,
    logo: (
      <img
        src="https://inkythuatso.com/uploads/images/2021/09/logo-bamboo-airways-inkythuatso-13-16-26-24.jpg"
        alt="logo-brand"
        width="100px"
      />
    ),
    brand: "BamBoo",
    flight: "VNU123",
    time: "09:10 - 11:25",
    price: 1200000,
  },
  {
    key: 1,
    logo: (
      <img
        src="https://static.wixstatic.com/media/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg/v1/fill/w_1000,h_626,al_c,q_90,usm_0.66_1.00_0.01/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg"
        alt="logo-brand"
        width="100px"
      />
    ),
    brand: "VietNam Airline",
    flight: "VNU123",
    time: "09:10 - 11:25",
    price: 1200000,
  },
  {
    key: 1,
    logo: (
      <img
        src="https://static.wixstatic.com/media/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg/v1/fill/w_1000,h_626,al_c,q_90,usm_0.66_1.00_0.01/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg"
        alt="logo-brand"
        width="100px"
      />
    ),
    brand: "VietNam Airline",
    flight: "VNU123",
    time: "09:10 - 11:25",
    price: 1200000,
  },
];

const columns = [
  {
    title: "",
    dataIndex: "logo",
    key: "logo",
    with: "10%",
  },
  {
    title: "Brand",
    dataIndex: "brand",
    key: "brand",
  },
  {
    title: "Chuyến bay",
    dataIndex: "flight",
    key: "flight",
  },
  {
    title: "Thời tgian",
    dataIndex: "time",
    key: "time",
  },
  {
    title: "Giá",
    dataIndex: "price",
    key: "price",
  },
  {
    action: "",
  },
];

function Flight() {
  return (
    <div className="wrapper">
      <h5>Kết quả tìm kiếm</h5>
      <Table columns={columns} dataSource={dataSource} />
    </div>
  );
}

export default Flight;
